import React from 'react';
import './'
import { Link, animateScroll as scroll } from 'react-scroll';

const Header = () => {
  const scrollToTop = () => {
    scroll.scrollToTop();
  };

  return (
    <nav className="navbar">
      <div className="navbar-content">
        <Link to="home" smooth={true} duration={500} className='navBarLink'>
          Home
        </Link>
        <Link to="about" smooth={true} duration={500} className='navBarLink'>
          About Me
        </Link>
        <Link to="contact" smooth={true} duration={500} className='navBarLink'>
          Contact Me
        </Link>
      </div>
    </nav>
  );
};

export default Header;
